import React from 'react';
import { Form, FormField, Button, TextInput, Box } from 'grommet';

function InputFormm() {

  
  return(
    <>
    <Box justify="center">
    <Box direction="column" alignSelf="center"  border={{ color: 'brand', size: 'small' }} pad="medium"> 
      <Form key={1}>
        <FormField label="Requestor" width="large">
          <TextInput placeholder="Enter Requestor"/>
        </FormField>
        <FormField label="PR Number" width="large">
          <TextInput placeholder="Enter PR Number" />
        </FormField>
        <FormField label="PO Number" width="large">
          <TextInput placeholder="Enter PO Number" />
        </FormField>
        <Button key={1} type="submit" alignSelf="end" primary label="Submit"  />
      </Form>
      </Box> 
      </Box> 
   </> 
  );
}


export default InputFormm;
